import styles from "./Works.module.scss";
import agencyProjectIcon from "../../images/agency.jpg";
import calcProjecticon from "../../images/calculator.4acb2cf3533331ba63f3.png";

type worksDetail = {
	imgSrc: string;
	text: string;
};

const worksDetails: worksDetail[] = [
	{
		imgSrc: agencyProjectIcon,
		text: "Agency",
	},
	{
		imgSrc: calcProjecticon,
		text: "Calculator",
	},
	{
		imgSrc: agencyProjectIcon,
		text: "Agency",
	},
	{
		imgSrc: agencyProjectIcon,
		text: "Agency",
	},
];

const Works = () => {
	return (
		<main className="relative grid gap-4  w-full h-[82vh] px-28  text-lg text-gray-600 ">
			{worksDetails.map((detail, i) => (
				<div
					key={i}
					className="flex flex-col items-center gap-1 w-80 h-72 rounded-md shadow-md"
				>
					<img
						src={detail.imgSrc}
						alt=""
						className="h-3/4 w-full rounded-md"
					/>
					<span>{detail.text}</span>
				</div>
			))}
		</main>
	);
};

export default Works;
